import React from "react";
import "./styles.css";

function Footer() {
  return (
    <div style={{ marginTop: "20%" }} className="Footer">
      <div
        style={{
          width: "150px",
          height: "150px",
          justifyContent: "space-around",
          alignItems: "center",
          display: "flex",
          flexDirection: "column",
        }}
      >
        <img
          alt="school logo"
          src={require("../Icons/logo white.png")}
          style={{ maxWidth: "100%", maxHeight: "100%" }}
        />
      </div>
      <div
        style={{
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "space-around",
        }}
      >
        <div>
          <span className="DevanshiBipinGanatra">
            Devanshi Bipin Ganatra <br />
          </span>
          FULL STACK DEVELOPER
        </div>
        <div>right side info: BELOW</div>
      </div>
    </div>
  );
}

export default Footer;
